 — Минимальная сумма комиссии составляет 0,01 ₼;
 — Комиссия применяется только при переводе средств на другие банковские карты.

fintech_payments_commission_conditions_c.en:
— akart doesn't apply any commission for monthly transfers up to 1,000 ₼;
— 1% commission fee will be applied when you exceed the amount;
— The minimum commission amount is 0.01 ₼;
— The commission is applicable only when transferring funds to other bank cards.
